import{_ as t,o as a,c as r,a as e}from"./app.d01b1be5.js";const o={},s=e('<h1 id="edward-teach" tabindex="-1"><a class="header-anchor" href="#edward-teach" aria-hidden="true">#</a> Edward Teach</h1><h2 id="a-man-s-battle" tabindex="-1"><a class="header-anchor" href="#a-man-s-battle" aria-hidden="true">#</a> A Man&#39;s Battle</h2><p><strong>Blackbeard:</strong> Big trouble, Mistah Fujimaru! Big trouble! There&#39;s a big trouble a brewin&#39;!</p><p><strong>Mash:</strong> Mistah Blackbeard... I can estimate with 99% probability that it&#39;s something stupid, but what is it?</p><p><strong>Blackbeard:</strong> Bwaha, Missy Mash has got a sharp tongue on her, don&#39;t she? But I like that, I do!</p><p><strong>Mash:</strong> ...Blackbeard, Master is actually pretty busy.</p><p><strong>Mash:</strong> There&#39;s a lot of work to be done with the Servants. Right, Senpai?</p><hr><p><strong>Fujimaru 1:</strong> Did something happen?</p><hr><p><strong>Fujimaru 2:</strong> Mash, isn&#39;t Mistah Blackbeard...</p><hr><p><strong>Blackbeard:</strong> With all the Grail business goin&#39; on, I forgot about it, but today&#39;s an important day in history.</p><p><strong>Blackbeard:</strong> I remembered that it&#39;s a historical turning point, I did.</p><p><strong>Dr. Roman:</strong> Today? Hmm... What happened today? There&#39;s nothing in Chaldea&#39;s database.</p><p><strong>Blackbeard:</strong> Today&#39;s when all the pirates of the Caribbean gather for the biggest event of the high seas!</p><p><strong>Blackbeard:</strong> The Pirate Market! AKA PaiKet, begins today!</p><p><strong>Blackbeard:</strong> Now, Missy Mash, Mistah Fujimaru! Repeat after me!</p><p><strong>Blackbeard:</strong> PAIKET!</p><p><strong>Fou:</strong> Fou...</p><p><strong>Mash:</strong> ...So Doctor, about that Singularity.</p><p><strong>Dr. Roman:</strong> Oh right. I rescanned the data and it turns out that era\u2013</p><p><strong>Blackbeard:</strong> Hnnng LOL Just the right amount of salt! It just makes me wanna try harder!</p><p><strong>Blackbeard:</strong> Come on, guys, whadd&#39;ya got to lose?</p><p><strong>Blackbeard:</strong> Come with me, and enjoy the flourishment of a new human culture!</p><hr><p><strong>Fujimaru 1:</strong> I guess it wouldn&#39;t hurt...</p><p><strong>Mash:</strong> If you say so, Senpai...</p><hr><p><strong>Fujimaru 2:</strong> I can&#39;t miss this!</p><p><strong>Mash:</strong> Senpai!</p><hr><p><strong>Mash:</strong> Dozens of ships linked into one big event venue. These people... What are they doing with their lives...</p><p><strong>Blackbeard:</strong> LOLOLOL How I&#39;ve missed that salty Caribbean air! Ya know, there&#39;s something I gotta say here!</p><p><strong>Blackbeard:</strong> Caribbean, I&#39;m back! Bwaha-LOLOLOL! Ahahaha! ROFL!</p><p><strong>Pirate:</strong> We&#39;ve been waiting for you, Mistah Blackbeard! They only hold the PaiKet every few years!</p><p><strong>Pirate:</strong> It&#39;s an honor to be here with you, the famous PaiKet warrior! Ahahaha-LOLOLOL!</p><p><strong>Mash:</strong> Um...Mistah Blackbeard, who are these people?</p><p><strong>Blackbeard:</strong> They&#39;re the comrades I&#39;ve gathered via the internet! I&#39;ve prepared carefully in advance.</p><p><strong>Blackbeard:</strong> Even I&#39;m not foolish enough to attempt to conquer this place on my own!</p><p><strong>Dr. Roman:</strong> So what do you do here, exactly? It just looks like a bazaar to me...</p><p><strong>Blackbeard:</strong> There&#39;s records of pirate glories, navigational maps, rare treasures, legendary treasure maps\u2013</p><p><strong>Blackbeard:</strong> We&#39;ve got the whole world, right here for the buying! Well? Sounds fun, right? Right?</p><hr><p><strong>Fujimaru 1:</strong> So it&#39;s like a flea market?</p><hr><p><strong>Fujimaru 2:</strong> What are you after?</p><hr><p><strong>Blackbeard:</strong> That&#39;s my Master/Captain/CEO! Getting right to the point!</p><p><strong>Blackbeard:</strong> Today I&#39;m after the legendary pirate Francis Drake&#39;s rough sketches!</p><p><strong>Blackbeard:</strong> Oh, by roughs, I mean nudes okay? Not just some crap somebody dashed off either, LOLOL!</p><p><strong>Blackbeard:</strong> I mean, I ain&#39;t interested in that old hag&#39;s nudes! Not at all! 100%, no way!</p><p><strong>Blackbeard:</strong> It&#39;s just, you know... For my collection? I wanna have em? Bwahahah-LOL!</p><p><strong>Mash:</strong> ...</p><p><strong>Dr. Roman:</strong> Those were made with her permission, right?</p><p><strong>Pirate Staff:</strong> \u2013We will now begin the 88th Pirate&#39;s Market. Please remain calm and do not run\u2013</p><p><strong>Blackbeard:</strong> ...</p><p><strong>Mash:</strong> Looks like it&#39;s started. What&#39;s wrong, Mistah Blackbeard?</p><p><strong>Blackbeard:</strong> Fool! Call me Cap&#39;n here! Men, are ye ready!</p><p><strong>Pirate:</strong> Aye, aye, Cap&#39;n!</p><p><strong>Blackbeard:</strong> Listen up! We&#39;re pirates of the Caribbean! We left our pride and lives behind in the sea!</p><p><strong>Blackbeard:</strong> We do what we always do: pillage, plunder, and kill! That&#39;s all there is to it! Let&#39;s go, men!</p><p><strong>Blackbeard:</strong> First, we start with the night campers, who are leading the charge toward us! Stay sharp!</p><p><strong>Mash:</strong> W-What&#39;s happening?</p><p><strong>Dr. Roman:</strong> A group&#39;s coming up from the rear at incredible speed...</p><p><strong>Blackbeard:</strong> YARGH! Send &#39;em to Davy Jones&#39; locker! Battle is a party, it&#39;s party time!</p><p><strong>--BATTLE--:</strong></p><p><strong>Blackbeard:</strong> Yar, that&#39;s the last of &#39;em! Hmm? More?</p><p><strong>Enemy Pirate:</strong> It&#39;s been a long time, Blackbeard... You&#39;re going to pay for embarrassing our captain!</p><p><strong>Blackbeard:</strong> Hah, I don&#39;t even know who ya are! Hey, Mash, Fujimaru!</p><p><strong>Blackbeard:</strong> Go on ahead! I&#39;m gonna slaughter these guys first!</p><p><strong>Mash:</strong> R-Right... This is a bazaar, isn&#39;t it?</p><hr><p><strong>Fujimaru 1:</strong> Thanks, Cap&#39;n!</p><hr><p><strong>Fujimaru 2:</strong> Don&#39;t die, Blackbeard!</p><hr><p><strong>Blackbeard:</strong> Huh? Who do ye think yer talkin&#39; to? I&#39;m Blackbeard, the devil of the Caribbean!</p><p><strong>Blackbeard:</strong> I ain&#39;t so far gone I need a wet-behind-the-ears kid to be lookin&#39; after me! Get going!</p><p><strong>Mash:</strong> L-Let&#39;s just go, Master!</p><p><strong>--BATTLE--:</strong></p><p><strong>Artist Pirate:</strong> Ya just bought the last copy of &quot;100 Sketches of Francis the Old Hag!&quot;</p><hr><p><strong>Fujimaru 1:</strong> That was close, huh?</p><hr><p><strong>Fujimaru 2:</strong> We finally got it!</p><hr><p><strong>Mash:</strong> ...L-Looks like we got the last one. Let&#39;s get back to Blackbeard.</p><p><strong>Dr. Roman:</strong> Um, well... What exactly is this?</p><p><strong>Fou:</strong> Foou...</p><p><strong>Dr. Roman:</strong> Oh, Fou... I didn&#39;t see you there.</p><p><strong>Blackbeard:</strong> ...Yar, looks like ya pulled it off.</p><p><strong>Mash:</strong> Blackbeard! You&#39;re badly hurt!</p><p><strong>Blackbeard:</strong> Eh, I&#39;m a pirate... It happens. Just glad to have me head on me shoulders still.</p><hr><p><strong>Fujimaru 1:</strong> Cap&#39;n! With those wounds...</p><hr><p><strong>Fujimaru 2:</strong> Blackbeard! Don&#39;t die on me!</p><hr><p><strong>Blackbeard:</strong> Yar, look at you, all grown up now... Hey, I got no regrets. I can die as a pirate.</p><p><strong>Blackbeard:</strong> This is the greatest treasure of &#39;em all... I just wish I could&#39;ve seen the treasure I sought once before I died...</p><p><strong>Blackbeard:</strong> Bye-bye! It was a great life! Farewell! Gwahahahahaha!</p><p><strong>Mash:</strong> Mistah Blackbeard...</p><hr><p><strong>Fujimaru 1:</strong> Mistah Blackbeard...</p><hr><p><strong>Fujimaru 2:</strong> Huh? Did that just happen?</p><hr><p><strong>Mash:</strong> \u2013Here&#39;s the sketchbook you sought. Take it and rest in peace.</p><p><strong>Fou:</strong> Foou...</p><p><strong>Blackbeard:</strong> Bwah!? This is the PaiKet-only Old Hag Sketchbook? There&#39;s a new issue out! A new one! I win!</p><p><strong>Blackbeard:</strong> I win at everything! I mean, I&#39;ve got huge respect for old hag Francis.</p><p><strong>Blackbeard:</strong> Though in my case, I like her, but less as a pirate.</p><p><strong>Blackbeard:</strong> More as a Pioneer of the Stars, I&#39;m a little weird that way, LOL.</p><p><strong>Blackbeard:</strong> Maybe it&#39;s Ferdinand Magellan&#39;s influence, ROFL. Bwahaha-LOLOLOL, ahem, excuse me.</p><p><strong>Blackbeard:</strong> This is what makes PaiKet so great, lolol. It&#39;s what makes me and the hag eternal, LOL!</p><p><strong>Dr. Roman:</strong> ...</p><p><strong>Dr. Roman:</strong> Shall we go home?</p><p><strong>Mash:</strong> Let&#39;s go home...</p><hr><p><strong>Fujimaru 1:</strong> Let&#39;s come back next year, okay?</p><p><strong>Mash:</strong> Huh?</p><hr><p><strong>Fujimaru 2:</strong> I&#39;m tired...</p><p><strong>Fou:</strong> Foou...</p><hr>',126),n=[s];function g(h,p){return a(),r("div",null,n)}var l=t(o,[["render",g],["__file","Edward Teach.html.vue"]]);export{l as default};
